// src/components/RouteList.js
import React from 'react';

export default function RouteList({ routes }) {
  return (
    <div className="route-list">
      <h2>Маршруты</h2>
      <table>
        <thead>
          <tr>
            <th>Откуда</th>
            <th>Куда</th>
            <th>Дата</th>
            <th>Цена</th>
          </tr>
        </thead>
        <tbody>
          {routes.map((route, index) => (
            <tr key={index}>
              <td>{route.from}</td>
              <td>{route.to}</td>
              <td>{new Date(route.date).toLocaleDateString()}</td>
              <td>{route.price} ₽</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}
